import React from 'react';
import aboutData from '../data/about'

function aragraphs(props) {
  return (
    <div className="service">
        <img src={props.img}/>
        <h3>{props.title}</h3>
        <p>{props.description}</p>
        <button>{props.btnText}</button>
    </div>
  );
}

function About() {
  return (
    <div>
      <h1>About ProRide</h1>
      {aboutData.map((data) => {
        <p>{data.paragraph}</p>
      })}
    </div>
  );
}

export default About;
